import styled from "styled-components";
import {Link} from 'react-router-dom'

const Header = styled.div`
width:100%;
height:4rem;
display:flex;
flex-direction: row;
background: white;
`

const MyA = styled.link`
text-decoration: none;
font-size:1.5rem;
background:transparent;
display:flex;

align-items: center;
margin: 0 2rem;
color: black;

`

const Navbar = () => {

return (
    <Header>
        <Link to='/'>Home</Link>
        <Link to='/'>Register</Link>
        <Link to='/'>Login</Link>


    </Header>

)

}
export default Navbar
